  let y = String(size.split('x')[1])

  // let className = 'gridItem gix-'+{x}+' giy-'+{y}

  return (
    <div className={'gridItem gix-'+x+' giy-'+y}>
      Clothing Grid: {x} by {y}
      <JacketIcon />
    </div>
  )
}

